// CPAGrid.js
import React from "react";

export default function CPAGrid({ employees, dates, month }) {
  return (
    <div className="inline-block border border-gray-300">
      <div className="grid grid-cols-[150px_100px_150px_repeat(11,80px)]">
        <div className="border p-1 font-bold row-span-4">Name</div>
        <div className="border p-1 font-bold row-span-4">Hourly</div>
        <div className="border p-1 font-bold row-span-4">Tax Report</div>

        {dates.map((day) => (
          <React.Fragment key={day}>
            <div className="border p-1 text-center font-bold">{`${month}/${day}`}</div>
          </React.Fragment>
        ))}

        {dates.map((day) => (
          <React.Fragment key={day}>
            <div className="border p-1 text-center">AM</div>
          </React.Fragment>
        ))}

        {dates.map((day) => (
          <React.Fragment key={day}>
            <div className="border p-1 text-center">PM</div>
          </React.Fragment>
        ))}

        {dates.map((day) => (
          <React.Fragment key={day}>
            <div className="border p-1 text-center">Hourly</div>
            <div className="border p-1 text-center">Tip</div>
          </React.Fragment>
        ))}

        {employees.map((emp) =>
          dates.map((day) => (
            <React.Fragment key={`${emp._id}-${day}`}>
              <div className="border p-1 text-center">{emp.name}</div>
              <div className="border p-1 text-center">{emp.hourlyPay}</div>
              <div className="border p-1 text-center">-</div>
              <div className="border p-1 text-center">-</div>
              <div className="border p-1 text-center">-</div>
              <div className="border p-1 text-center">-</div>
            </React.Fragment>
          ))
        )}
      </div>
    </div>
  );
}
